import "./TheatrePage.scss";
import rec1 from "./TP photos/Rectangle 1.png";
import rec2 from "./TP photos/Rectangle 2.png";
import rec3 from "./TP photos/Rectangle 3.png";
import rec4 from "./TP photos/Rectangle 4.png";
